edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/attach_logging_expectations.proto";
import "youtube/api/innertube/screen_created_logging_expectations.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message LoggingExpectations {
	AttachLoggingExpectations attach_logging_expectations = 1;
	ScreenCreatedLoggingExpectations screen_created_logging_expectations = 2;
}
